) Mình chia tay nhau rồi phải không anh? Thật sự rồi phải không anh. Em vẫn chưa tin đó là sự thật, dù không biết đã bao nhiêu lần em muốn nói chúng mình chia tay nhau đi, đừng ở bên nhau nữa, sẽ đau khổ nhiều lắm. 12:10 | Thứ bảy 31/12/2005 (GMT+7) Mỗi sáng đi làm, anh đều ôm và hôn lên má tôi. Nụ hôn dành cho tôi giống như hôn một đứa trẻ. Anh hôn lên trán, lên má tôi và không bao giờ hôn lên môi tôi, ngoại trừ lúc anh và tôi làm chuyện ấy. Nhiều lúc tôi ôm anh chỉ mong anh hiểu tôi muốn gì mà
